//----------
//Components
//----------
import React, {Component} from 'react';
import '../styles/Art.css'

class Art extends Component {
  render() {
    return(
        <div className="art-card">
          <img src={this.props.img} alt='.'/>
          <div className="card-body">
            <h2>{this.props.title}</h2>
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam.</p>
            <h5>{this.props.author}</h5>
          </div>
        </div>
    )
  }
}

class ArtCards extends Component {
  render() {
    return (
      <>
       <div class="header">
         <h1>React Card Component</h1>
         <h3>A simple and responsive card component in React with clean hover effects. Copy and customise.</h3>
       </div>
      
       <div className='cards'>
         <Art
          img='../img/holder1'
          title='Cincinnati Musuem'
          author='Nancy Wheeler' />
      </div>  
      </>
    )
  }
}

//----------
//Final render
//----------

export default (Art, ArtCards)
